lockfileVersion: '9.0'

settings:
  autoInstallPeers: true
  excludeLinksFromLockfile: false

importers:

  .:
    dependencies:
      replicate:
        specifier: file:../replicate
        version: file:../replicate
    devDependencies:
      '@replicate/models.meta.llama2':
        specifier: file:../meta.llama2
        version: file:../meta.llama2(replicate@file:../replicate)
      '@replicate/models.openai.gpt4_5':
        specifier: file:../openai.gpt4_5
        version: file:../openai.gpt4_5(replicate@file:../replicate)
      typescript:
        specifier: ~5.8.3
        version: 5.8.3

packages:

  '@replicate/models.meta.llama2@file:../meta.llama2':
    resolution: {directory: ../meta.llama2, type: directory}
    peerDependencies:
      replicate: file:../replicate

  '@replicate/models.openai.gpt4_5@file:../openai.gpt4_5':
    resolution: {directory: ../openai.gpt4_5, type: directory}
    peerDependencies:
      replicate: file:../replicate

  replicate@file:../replicate:
    resolution: {directory: ../replicate, type: directory}

  typescript@5.8.3:
    resolution: {integrity: sha512-p1diW6TqL9L07nNxvRMM7hMMw4c5XOo/1ibL4aAIGmSAt9slTE1Xgw5KWuof2uTOvCg9BY7ZRi+GaF+7sfgPeQ==}
    engines: {node: '>=14.17'}
    hasBin: true

snapshots:

  '@replicate/models.meta.llama2@file:../meta.llama2(replicate@file:../replicate)':
    dependencies:
      replicate: file:../replicate

  '@replicate/models.openai.gpt4_5@file:../openai.gpt4_5(replicate@file:../replicate)':
    dependencies:
      replicate: file:../replicate

  replicate@file:../replicate: {}

  typescript@5.8.3: {}
